   <div>
     <div className="jumbotron">
       <h1>Game Mode</h1>
       <button type="button" id="singleBtn" class="btn btn-primary">Single Player</button>
       <button type="button" id="multiBtn" class="btn btn-success">Multiplayer</button>
       </div>
       </div>
 );
}
}
